                value:
                  string:
                    tag: string
                    value:
                      object:
                        tag: object
                        value: It was first applied to the winds over the Arabian
                          Sea which blow for six months from northeast and for six
                          months from southwest but it has been extended to similar
                          winds in other parts of the world Even in Europe the prevailing
                          west to northwest winds of summer have been called the European
                          monsoon The primary cause is the much greater annual variation
                          of temperature over large land areas compared with neighboring
                          ocean surfaces causing an excess of pressure over the continents
                          in winter and a deficit in summer but other factors such
                          as the relief features of the land have a considerable effect
                          The monsoons are strongest on the southern and eastern sides
                          of Asia the largest landmass but monsoons also occur on
                          the coasts of tropical regions wherever the planetary circulation
                          is not strong enough to inhibit them They have been described
                          in Spain northern Australia Africa except the Mediterranean
                          Texas and the western coasts of the United States and Chile
                          In India the term is popularly applied chiefly to the southwest
                          monsoon and by extension to the rains which it brings
